from heapq import heappop, heappush

global heap;
heap = list()

def solve(MAX):
	global heap;
	arr = [1]
	for i in range(MAX):
		h = heappop(arr)
		while arr and h==arr[0]:
			heappop(arr)
		for x in [2, 3, 5]:
			heappush(arr, x * h)
		heap.append(h)

